 26    var body: some View {
 27        VStack(spacing: 40) {
 28            Spacer()
 29
 30            // Header
 31            VStack(spacing: 8) {
 32                Image(systemName: "lock.shield.fill")
 33                    .font(.system(size: 48))
 34                    .foregroundStyle(.vaultSecondaryText)
 35                    .accessibilityHidden(true)
 36
 37                Text(isVoiceOverActive ? "Unlock Your Vault" : "Draw your pattern")
 38                    .font(.title2)
 39                    .fontWeight(.medium)
 40            }
