 42            // VoiceOver: promote recovery phrase above grid
 43            if isVoiceOverActive {
 44                VStack(spacing: 12) {
 45                    Text("VoiceOver is active. Use your recovery phrase to unlock.")
 46                        .font(.subheadline)
 47                        .foregroundStyle(.vaultSecondaryText)
 48                        .multilineTextAlignment(.center)
 49                        .padding(.horizontal)
 50
 51                    Button(action: { showRecoveryOption = true }) {
 52                        Text("Use Recovery Phrase")
 53                            .font(.headline)
