 55                            .padding()
 56                    }
 57                    .vaultProminentButtonStyle()
 58                    .padding(.horizontal, 40)
 59                    .accessibilityHint("Unlock vault using your recovery phrase instead of drawing a pattern")
 60                }
 61            }
 62
 63            Spacer()
 64
 65            // Pattern Grid
 66            PatternGridView(
 67                state: patternState,
 68                showFeedback: $showFeedback,
 69                onPatternComplete: handlePatternComplete
 70            )
 71            .frame(maxWidth: 280, maxHeight: 280)
 72            .disabled(isProcessing)
 73            .opacity(isVoiceOverActive ? 0.3 : (isProcessing ? 0.5 : 1))
 74            .accessibilityIdentifier("unlock_pattern_grid")
 75
 76            // Error message  overlay so it never shifts the grid
 77            Color.clear
 78                .frame(height: 0)
 79                .overlay(alignment: .top) {
 80                    if showError, let message = errorMessage {
 81                        HStack(spacing: 8) {
 82                            Image(systemName: "exclamationmark.circle.fill")
 83                            Text(message)
 84                                .font(.subheadline)
 85                        }
 86                        .foregroundStyle(.white)
 87                        .padding(.horizontal, 16)
 88                        .padding(.vertical, 10)
 89                        .background(Color.vaultHighlight.opacity(0.9))
 90                        .clipShape(RoundedRectangle(cornerRadius: 8))
 91                        .transition(.scale.combined(with: .opacity))
 92                    }
 93                }
 94
 95            Spacer()
 96
 97            // Options (hidden when VoiceOver promotes recovery above)
 98            if !isVoiceOverActive {
 99                VStack(spacing: 12) {
100                    Button(action: { showRecoveryOption = true }) {
101                        Text("Use recovery phrase")
102                            .font(.subheadline)
103                            .foregroundStyle(.vaultSecondaryText)
104                            .frame(minHeight: 44)
105                    }
106                    .accessibilityIdentifier("unlock_recovery_link")
107                    .accessibilityHint("Unlock vault using your recovery phrase instead of drawing a pattern")
108
109                    Button(action: { showJoinSharedVault = true }) {
110                        Text("Join shared vault")
111                            .font(.subheadline)
112                            .foregroundStyle(.vaultSecondaryText)
113                            .frame(minHeight: 44)
114                    }
115                    .accessibilityIdentifier("unlock_join_link")
116                    .accessibilityHint("Enter a share phrase to access a vault shared with you")
117                }
