129            Spacer()
130        }
131        .padding()
132        .animation(reduceMotion ? nil : .spring(response: 0.3), value: showError)
133        .sheet(isPresented: $showRecoveryOption) {
134            RecoveryPhraseInputView()
135                .interactiveDismissDisabled()
