143    private func handlePatternComplete(_ pattern: [Int]) {
144        patternLockLogger.debug("Pattern completed, count=\(pattern.count)")
145        
146        guard !isProcessing else {
147            patternLockLogger.debug("Already processing, ignoring pattern")
148            return
149        }
150        
151        // Require minimum pattern length to prevent accidental taps
152        guard pattern.count >= 6 else {
153            patternLockLogger.debug("Pattern too short: \(pattern.count) nodes, minimum 6 required")
154            
155            // Show error message to user
156            errorMessage = "Pattern must connect at least 6 dots"
157            UINotificationFeedbackGenerator().notificationOccurred(.warning)
158            withAnimation {
159                showError = true
160            }
161            
162            // Hide error after 2 seconds and reset pattern
163            Task {
164                try? await Task.sleep(nanoseconds: 2_000_000_000)
165                await MainActor.run {
166                    withAnimation {
167                        showError = false
168                    }
169                }
170            }
171            
172            patternState.reset()
173            return
174        }
175
176        // Clear any previous error
177        showError = false
178        
179        patternLockLogger.debug("Pattern accepted, processing unlock")
180        
181        isProcessing = true
182
183        Task {
184            // Derive key once  reused for both the free-tier gate check and unlock
185            let derivedKey: Data?
186            do {
187                derivedKey = try await KeyDerivation.deriveKey(from: pattern, gridSize: 5)
188            } catch {
189                derivedKey = nil
190            }
191
192            // Check if this pattern creates a new vault and if the user is at the free limit
193            if !subscriptionManager.isPremium, let key = derivedKey {
194                if !VaultStorage.shared.vaultExists(for: key) {
195                    let vaultCount = VaultStorage.shared.existingVaultCount()
196                    if !subscriptionManager.canCreateVault(currentCount: vaultCount) {
197                        await MainActor.run {
198                            isProcessing = false
199                            patternState.reset()
200                            showingPaywall = true
201                        }
202                        return
203                    }
204                }
205            }
206
207            // Attempt to unlock, passing pre-derived key to avoid double PBKDF2
208            let unlocked = await appState.unlockWithPattern(pattern, gridSize: 5, precomputedKey: derivedKey)
209
210            await MainActor.run {
211                if unlocked {
212                    UINotificationFeedbackGenerator().notificationOccurred(.success)
213                } else {
214                    UINotificationFeedbackGenerator().notificationOccurred(.error)
215                }
216                isProcessing = false
217                patternState.reset()
218            }
219        }
220    }
221}
