225struct RecoveryPhraseInputView: View {
226    @Environment(AppState.self) private var appState
227    @Environment(\.dismiss) private var dismiss
228
229    @State private var phrase = ""
230    @State private var isProcessing = false
231    @State private var errorMessage: String?
232
233    var body: some View {
234        NavigationStack {
235            VStack(spacing: 24) {
236                Text("Enter your recovery phrase")
237                    .font(.headline)
238
239                Text("This is the memorable sentence you created when setting up your vault.")
240                    .font(.subheadline)
241                    .foregroundStyle(.vaultSecondaryText)
242                    .multilineTextAlignment(.center)
243
244                TextEditor(text: $phrase)
245                    .frame(height: 120)
246                    .padding(8)
247                    .background(Color.vaultSurface)
248                    .clipShape(RoundedRectangle(cornerRadius: 12))
249                    .autocorrectionDisabled()
250                    .textInputAutocapitalization(.never)
251
252                Button(action: attemptRecovery) {
253                    if isProcessing {
254                        ProgressView()
255                    } else {
256                        Text("Recover Vault")
257                    }
258                }
259                .vaultProminentButtonStyle()
260                .disabled(phrase.isEmpty || isProcessing)
261
262                if let error = errorMessage {
263                    HStack(spacing: 8) {
264                        Image(systemName: "exclamationmark.circle.fill")
265                            .foregroundStyle(.vaultHighlight)
266                        Text(error)
267                            .font(.caption)
268                            .foregroundStyle(.vaultHighlight)
269                    }
270                    .padding()
271                    .vaultGlassTintedBackground(tint: Color.vaultHighlight, cornerRadius: 8)
272                }
273
274                Spacer()
275            }
276            .padding()
277            .navigationTitle("Recovery")
278            .navigationBarTitleDisplayMode(.inline)
279            .toolbar {
280                ToolbarItem(placement: .cancellationAction) {
281                    Button("Cancel") { dismiss() }
282                }
283            }
284        }
285    }
286
287    private func attemptRecovery() {
288        isProcessing = true
289
290        Task {
291            do {
292                // Use the recovery manager to recover the vault
293                let patternKey = try await RecoveryPhraseManager.shared.recoverVault(using: phrase)
294                
295                patternLockLogger.info("Vault recovered successfully")
296                
297                // Use the recovered pattern key to unlock the vault
298                await MainActor.run {
299                    appState.currentVaultKey = patternKey
300                    appState.isUnlocked = true
301                    dismiss()
302                    
303                    patternLockLogger.debug("Vault unlocked with recovery phrase")
304                }
305            } catch RecoveryError.invalidPhrase {
306                patternLockLogger.info("Invalid recovery phrase")
307                await MainActor.run {
308                    showRecoveryError("Incorrect recovery phrase. Please check and try again.")
309                }
310            } catch {
311                patternLockLogger.error("Recovery failed: \(error.localizedDescription, privacy: .public)")
312                await MainActor.run {
313                    showRecoveryError("Recovery failed: \(error.localizedDescription)")
314                }
315            }
316        }
317    }
318    
319    @MainActor
320    private func showRecoveryError(_ message: String) {
321        errorMessage = message
322        isProcessing = false
323    }
324    
325}
