219    // MARK: - Actions
220
221    private func handlePatternComplete(_ pattern: [Int]) {
222        switch patternStep {
223        case .create:
224            let result = PatternValidator.shared.validate(pattern, gridSize: patternState.gridSize)
225            validationResult = result
226
227            if result.isValid {
228                errorMessage = nil
229                newPattern = pattern
230                patternStep = .confirm
231                patternState.reset()
232            } else {
233                patternState.reset()
234            }
235
236        case .confirm:
237            if pattern == newPattern {
238                patternState.reset()
239                Task { await setupSharedVault() }
240            } else {
241                errorMessage = "Patterns don't match. Try again."
242                patternState.reset()
243                Task {
244                    try? await Task.sleep(nanoseconds: 2_500_000_000)
245                    await MainActor.run { errorMessage = nil }
246                }
247            }
248        }
249    }
250
251    private func setupSharedVault() async {
252        let trimmedPhrase = phrase.trimmingCharacters(in: .whitespacesAndNewlines)
253        guard !trimmedPhrase.isEmpty else {
254            mode = .error("Invalid share link  no phrase found.")
255            return
256        }
257
258        do {
259            let patternKey = try await KeyDerivation.deriveKey(from: newPattern, gridSize: 5)
260
261            appState.currentVaultKey = patternKey
262            appState.currentPattern = newPattern
263            let letters = GridLetterManager.shared.vaultName(for: newPattern)
264            appState.updateVaultName(letters.isEmpty ? "Vault" : "Vault \(letters)")
265
266            let emptyIndex = VaultStorage.VaultIndex(
267                files: [],
268                nextOffset: 0,
269                totalSize: 500 * 1024 * 1024
270            )
271            try VaultStorage.shared.saveIndex(emptyIndex, with: patternKey)
272
273            appState.isUnlocked = true
274            deepLinkHandler.clearPending()
275            dismiss()
276
277            BackgroundShareTransferManager.shared.startBackgroundDownloadAndImport(
278                phrase: trimmedPhrase,
279                patternKey: patternKey
280            )
281        } catch {
282            mode = .error("Failed to set up vault: \(error.localizedDescription)")
283        }
284    }
285}
