 3/// Shared validation feedback view for pattern creation screens.
 4/// Displays errors (red, blocking), warnings (yellow, informational),
 5/// and pattern complexity/strength score.
 6///
 7/// Used by: PatternSetupView, ChangePatternView, JoinVaultView, SharedVaultInviteView
 8struct PatternValidationFeedbackView: View {
 9    let result: PatternValidationResult
10
11    var body: some View {
12        VStack(alignment: .leading, spacing: 8) {
13            // Errors
14            ForEach(Array(result.errors.enumerated()), id: \.offset) { _, error in
15                HStack {
16                    Image(systemName: "xmark.circle.fill")
17                        .foregroundStyle(.vaultHighlight)
18                    Text(error.message)
19                        .font(.caption)
20                }
21            }
22
23            // Warnings (only if no errors)
24            if result.errors.isEmpty {
25                ForEach(Array(result.warnings.prefix(2).enumerated()), id: \.offset) { _, warning in
26                    HStack {
27                        Image(systemName: "exclamationmark.triangle.fill")
28                            .foregroundStyle(.vaultHighlight)
29                        Text(warning.rawValue)
30                            .font(.caption)
31                    }
32                }
33            }
34
35            // Complexity score
36            if result.errors.isEmpty {
37                let description = PatternValidator.shared.complexityDescription(for: result.metrics.complexityScore)
38                HStack {
39                    Image(systemName: "shield.fill")
40                        .foregroundStyle(result.metrics.complexityScore >= 30 ? .green : .orange)
41                    Text("Strength: \(description)")
42                        .font(.caption)
43                        .fontWeight(.medium)
44                }
45            }
46        }
47        .padding()
48        .frame(maxWidth: .infinity, alignment: .leading)
49        .vaultGlassBackground(cornerRadius: 12)
50    }
51}
