 719    // MARK: - Logic
 720
 721    private func checkiCloudAvailable() async -> Bool {
 722        let status = await CloudKitSharingManager.shared.checkiCloudStatus()
 723        // .temporarilyUnavailable means signed in but CloudKit still syncing  treat as available
 724        return status == .available || status == .temporarilyUnavailable
 725    }
 726
 727    private func onAppear() {
 728        Task {
 729            let available = await checkiCloudAvailable()
 730            iCloudAvailable = available
 731            if !available && isBackupEnabled {
 732                isBackupEnabled = false
 733            }
 734            // Auto-backup if enabled and overdue
 735            if isBackupEnabled && available && isBackupOverdue {
 736                performBackup()
 737            }
 738        }
 739    }
