 741    private func handleToggleChange(_ enabled: Bool) {
 742        guard enabled else { return }
 743
 744        // Check iCloud via CloudKit account status before allowing enable
 745        Task {
 746            let available = await checkiCloudAvailable()
 747            guard available else {
 748                isBackupEnabled = false
 749                iCloudAvailable = false
 750                return
 751            }
 752            // First enable  run backup immediately
 753            performBackup()
 754        }
 755    }
 756
 757    private func performBackup() {
 758        guard let key = appState.currentVaultKey else {
 759            errorMessage = "No vault key available"
 760            return
 761        }
 762
 763        isBackingUp = true
 764        backupStage = nil
 765        uploadProgress = 0
 766        errorMessage = nil
 767        UIApplication.shared.isIdleTimerDisabled = true
 768
 769        backupTask = Task {
 770            defer {
 771                Task { @MainActor in
 772                    UIApplication.shared.isIdleTimerDisabled = false
 773                }
 774            }
 775            do {
 776                try await backupManager.performBackup(with: key, onProgress: { stage in
 777                    Task { @MainActor in
 778                        backupStage = stage
 779                    }
 780                }, onUploadProgress: { progress in
 781                    Task { @MainActor in
 782                        uploadProgress = progress
 783                    }
 784                })
 785                await MainActor.run {
 786                    lastBackupTimestamp = Date().timeIntervalSince1970
 787                    isBackingUp = false
 788                    backupStage = nil
 789                }
 790            } catch is CancellationError {
 791                await MainActor.run {
 792                    isBackingUp = false
 793                    backupStage = nil
 794                }
 795            } catch iCloudError.notAvailable {
 796                await MainActor.run {
 797                    errorMessage = "iCloud is not available. Check that you're signed in to iCloud in Settings."
 798                    isBackingUp = false
 799                    backupStage = nil
 800                }
 801            } catch iCloudError.fileNotFound {
 802                await MainActor.run {
 803                    errorMessage = "No vault data found to back up. Add some files first."
 804                    isBackingUp = false
 805                    backupStage = nil
 806                }
 807            } catch {
 808                await MainActor.run {
 809                    errorMessage = "\(error.localizedDescription)\n\nError type: \(type(of: error))\nDetails: \(error)"
 810                    isBackingUp = false
 811                    backupStage = nil
 812                }
 813            }
 814        }
 815    }
 816}
