 900            Text("Your vault has been restored. Lock and re-enter your pattern to access it.")
 901                .foregroundStyle(.vaultSecondaryText)
 902                .multilineTextAlignment(.center)
 903                .padding(.horizontal)
 904
 905            Button("Done") { dismiss() }
 906                .buttonStyle(.borderedProminent)
