 912    private var restoreContentView: some View {
 913        VStack(spacing: 16) {
 914            if let info = backupInfo {
 915                HStack(spacing: 12) {
 916                    Image(systemName: "icloud.fill")
 917                        .foregroundStyle(Color.accentColor)
 918                    VStack(alignment: .leading, spacing: 2) {
 919                        Text("Backup from \(info.formattedDate)")
 920                            .font(.subheadline.weight(.medium))
 921                        Text(info.formattedSize)
 922                            .font(.caption)
 923                            .foregroundStyle(.vaultSecondaryText)
 924                    }
 925                }
 926                .padding(.horizontal)
 927                .padding(.top, 8)
 928            }
 929
 930            if isRestoring {
 931                VStack(spacing: 12) {
 932                    ProgressView()
 933                    Text(restoreStage ?? "Restoring...")
 934                        .font(.subheadline)
 935                        .foregroundStyle(.vaultSecondaryText)
 936                }
 937                .padding(.top, 40)
 938            } else {
 939                Text("Draw your pattern to decrypt the backup")
 940                    .font(.subheadline)
 941                    .foregroundStyle(.vaultSecondaryText)
 942                    .multilineTextAlignment(.center)
 943
 944                PatternGridView(state: patternState, showFeedback: $showFeedback) { pattern in
 945                    performRestore(with: pattern)
 946                }
 947                .frame(width: 280, height: 280)
 948                .padding()
 949            }
 950
 951            if let errorMessage {
 952                VStack(alignment: .leading, spacing: 4) {
 953                    Label("Restore Failed", systemImage: "exclamationmark.triangle.fill")
 954                        .foregroundStyle(.red)
 955                        .font(.subheadline.weight(.medium))
 956                    Text(errorMessage)
 957                        .foregroundStyle(.vaultSecondaryText)
 958                        .font(.caption)
 959                        .textSelection(.enabled)
 960                }
 961                .padding(.horizontal)
 962
 963                Button("Try Again") {
 964                    resetForRetry()
 965                }
 966                .font(.subheadline)
 967            }
 968
 969            Spacer()
 970        }
 971    }
 972
 973    private func resetForRetry() {
 974        errorMessage = nil
 975        patternState.reset()
 976    }
 977
 978    private func checkForBackup() async {
 979        isCheckingBackup = true
 980        let result = await backupManager.checkForBackup()
 981        await MainActor.run {
 982            switch result {
 983            case .found(let info):
 984                backupInfo = info
 985                noBackupFound = false
 986            case .notFound:
 987                noBackupFound = true
 988            case .error(let message):
 989                noBackupFound = true
 990                errorMessage = message
 991            }
 992            isCheckingBackup = false
 993        }
 994    }
 995
 996    private func performRestore(with pattern: [Int]) {
 997        guard pattern.count >= 6 else {
 998            patternState.reset()
 999            return
1000        }
1001
1002        isRestoring = true
1003        errorMessage = nil
1004        restoreStage = "Deriving encryption key..."
1005
1006        Task {
1007            do {
1008                let key = try await KeyDerivation.deriveKey(from: pattern, gridSize: patternState.gridSize)
1009
1010                await MainActor.run { restoreStage = "Downloading from iCloud..." }
1011                try await backupManager.restoreBackup(with: key)
1012
1013                await MainActor.run {
1014                    isRestoring = false
1015                    restoreSuccess = true
1016                }
1017            } catch iCloudError.notAvailable {
1018                await MainActor.run {
1019                    errorMessage = "iCloud is not available. Check your connection and try again."
1020                    isRestoring = false
1021                    patternState.reset()
1022                }
1023            } catch iCloudError.downloadFailed {
1024                await MainActor.run {
1025                    errorMessage = "Decryption failed. This usually means the pattern doesn't match the one used to create the backup."
1026                    isRestoring = false
1027                    patternState.reset()
1028                }
1029            } catch {
1030                await MainActor.run {
1031                    errorMessage = "\(error.localizedDescription)\n\nDetails: \(error)"
1032                    isRestoring = false
1033                    patternState.reset()
1034                }
1035            }
1036        }
1037    }
1038}
