 547                    newPattern = []
 548                    patternState.reset()
 549                    errorMessage = nil
 550                    validationResult = nil
 551                }
 552                .hidden()
 553
 554            case .createNew:
 555                Button("Clear") {
 556                    patternState.reset()
 557                    errorMessage = nil
 558                    validationResult = nil
 559                }
 560                .disabled(patternState.selectedNodes.isEmpty || isProcessing)
 561
 562                Button("Start Over") {
 563                    step = .verifyCurrent
 564                    currentPattern = []
 565                    newPattern = []
 566                    patternState.reset()
 567                    errorMessage = nil
 568                    validationResult = nil
 569                }
 570                .disabled(isProcessing)
 571
 572            case .confirmNew:
 573                Button("Clear") {
 574                    patternState.reset()
 575                    errorMessage = nil
 576                    validationResult = nil
 577                }
 578                .hidden()
 579
 580                Button("Start Over") {
 581                    step = .verifyCurrent
 582                    currentPattern = []
 583                    newPattern = []
 584                    patternState.reset()
 585                    errorMessage = nil
 586                    validationResult = nil
 587                }
 588                .disabled(isProcessing)
 589
 590            case .complete:
 591                Button(action: { dismiss() }) {
 592                    Text("Done")
 593                        .font(.headline)
 594                        .frame(maxWidth: .infinity)
 595                        .padding()
 596                }
 597                .vaultProminentButtonStyle()
 598            }
 599        }
 600    }
 601
 602    // MARK: - Actions
 603
 604    private func handlePatternComplete(_ pattern: [Int]) {
 605        vaultSettingsLogger.debug("Pattern completed in \(String(describing: step), privacy: .public) step")
 606        
 607        switch step {
 608        case .verifyCurrent:
 609            verifyCurrentPattern(pattern)
 610            
 611        case .createNew:
 612            validateNewPattern(pattern)
 613            
 614        case .confirmNew:
 615            confirmNewPattern(pattern)
 616            
 617        case .complete:
 618            break
 619        }
 620    }
 621    
 622    private func verifyCurrentPattern(_ pattern: [Int]) {
 623        guard let currentKey = appState.currentVaultKey else {
 624            errorMessage = "No vault key available"
 625            patternState.reset()
 626            return
 627        }
 628
 629        // Validate pattern structure first
 630        let validation = PatternValidator.shared.validate(pattern, gridSize: patternState.gridSize)
 631        if !validation.isValid {
 632            errorMessage = validation.errors.first?.message ?? "Invalid pattern"
 633            patternState.reset()
 634            return
 635        }
 636
 637        isProcessing = true
 638
 639        Task {
 640            do {
 641                // Derive key from entered pattern and check if it matches current key
 642                let enteredKey = try await KeyDerivation.deriveKey(from: pattern, gridSize: patternState.gridSize)
 643                
 644                await MainActor.run {
 645                    if enteredKey == currentKey {
 646                        // Pattern verified - move to next step
 647                        vaultSettingsLogger.debug("Current pattern verified")
 648                        currentPattern = pattern
 649                        step = .createNew
 650                        patternState.reset()
 651                        errorMessage = nil
 652                    } else {
 653                        // Pattern doesn't match
 654                        vaultSettingsLogger.debug("Current pattern incorrect")
 655                        errorMessage = "Incorrect pattern. Please try again."
 656                        patternState.reset()
 657                    }
 658                    isProcessing = false
 659                }
 660            } catch {
 661                await MainActor.run {
 662                    errorMessage = "Error verifying pattern: \(error.localizedDescription)"
 663                    patternState.reset()
 664                    isProcessing = false
 665                }
 666            }
 667        }
 668    }
 669    
 670    private func validateNewPattern(_ pattern: [Int]) {
 671        isProcessing = true
 672        
 673        Task {
 674            // First, validate the pattern structure
 675            let result = PatternValidator.shared.validate(pattern, gridSize: patternState.gridSize)
 676
 677            await MainActor.run {
 678                validationResult = result
 679            }
 680
 681            if result.isValid {
 682                // Check if this pattern already exists as another vault
 683                do {
 684                    let newKey = try await KeyDerivation.deriveKey(from: pattern, gridSize: patternState.gridSize)
 685                    
 686                    // Check if a vault with this key already exists
 687                    let vaultExists = VaultStorage.shared.vaultExists(for: newKey)
 688                    
 689                    await MainActor.run {
 690                        if vaultExists {
 691                            vaultSettingsLogger.info("Pattern already used by another vault")
 692                            errorMessage = "This pattern is already used by another vault. Please choose a different pattern."
 693                            patternState.reset()
 694                        } else {
 695                            vaultSettingsLogger.debug("New pattern valid and unique")
 696                            newPattern = pattern
 697                            step = .confirmNew
 698                            patternState.reset()
 699                            errorMessage = nil
 700                        }
 701                        isProcessing = false
 702                    }
 703                } catch {
 704                    await MainActor.run {
 705                        errorMessage = "Error checking pattern: \(error.localizedDescription)"
 706                        patternState.reset()
 707                        isProcessing = false
 708                    }
 709                }
 710            } else {
 711                vaultSettingsLogger.debug("New pattern invalid")
 712                await MainActor.run {
 713                    patternState.reset()
 714                    isProcessing = false
 715                }
 716            }
 717        }
 718    }
 719    
 720    private func confirmNewPattern(_ pattern: [Int]) {
 721        let validation = PatternValidator.shared.validate(pattern, gridSize: patternState.gridSize)
 722        if !validation.isValid {
 723            errorMessage = validation.errors.first?.message ?? "Invalid pattern"
 724            patternState.reset()
 725            return
 726        }
 727
 728        if pattern == newPattern {
 729            vaultSettingsLogger.debug("Patterns match, updating vault")
 730            updateVaultPattern(pattern)
 731        } else {
 732            vaultSettingsLogger.debug("Patterns don't match")
 733            errorMessage = "Patterns don't match. Please try again."
 734            patternState.reset()
 735        }
 736    }
 737    
 738    private func updateVaultPattern(_ newPattern: [Int]) {
 739        guard let oldKey = appState.currentVaultKey else {
 740            errorMessage = "No vault key available"
 741            return
 742        }
 743        
 744        isProcessing = true
 745        
 746        Task {
 747            do {
 748                // 1. Derive new key from new pattern
 749                let newKey = try await KeyDerivation.deriveKey(from: newPattern, gridSize: patternState.gridSize)
 750                
 751                vaultSettingsLogger.trace("New key derived")
 752                
 753                // 2. Change vault key (instant operation - only re-encrypts master key)
 754                try VaultStorage.shared.changeVaultKey(from: oldKey, to: newKey)
 755                
 756                vaultSettingsLogger.debug("Vault key changed")
 757                
 758                // 3. Generate a new recovery phrase
 759                let recoveryPhrase = RecoveryPhraseGenerator.shared.generatePhrase()
 760                
 761                vaultSettingsLogger.trace("New recovery phrase generated")
 762                
 763                // 4. Save the new recovery phrase with the new key
 764                try await RecoveryPhraseManager.shared.saveRecoveryPhrase(
 765                    phrase: recoveryPhrase,
 766                    pattern: newPattern,
 767                    gridSize: patternState.gridSize,
 768                    patternKey: newKey
 769                )
 770                
 771                vaultSettingsLogger.debug("Recovery phrase saved with new key")
 772                
 773                // 5. Delete old recovery data
 774                try await RecoveryPhraseManager.shared.deleteRecoveryData(for: oldKey)
 775                
 776                vaultSettingsLogger.debug("Old recovery data deleted")
 777                
 778                SentryManager.shared.addBreadcrumb(category: "settings.patternChanged")
 779
 780                // 6. Update app state with new key
 781                await MainActor.run {
 782                    appState.currentVaultKey = newKey
 783                    newRecoveryPhrase = recoveryPhrase
 784                    step = .complete
 785                    isProcessing = false
 786                    errorMessage = nil
 787
 788                    vaultSettingsLogger.info("Pattern change complete")
 789                }
 790            } catch {
 791                vaultSettingsLogger.error("Error updating pattern: \(error.localizedDescription, privacy: .public)")
 792                await MainActor.run {
 793                    errorMessage = "Failed to update pattern: \(error.localizedDescription)"
 794                    patternState.reset()
 795                    isProcessing = false
 796                }
 797            }
 798        }
 799    }
 800}
